import React from 'react';
import ShopAllMenu from '../../../components/shop-all-menu/shop-all-menu.component';
import CollectionPage from '../../components/collection/collection.component';
import './collection-page.style.css';

const EachCollectionPage = () => (
    <div className='eachCollectionHeader-container'>

        <div className='eachCollectionPage-content-container'>
            <ShopAllMenu />
            <CollectionPage />
        </div>
    </div>
);

export default EachCollectionPage;
